import React, { useState } from 'react';
import { Box, Container, Typography, Card, CardContent, Grid, Button, TextField, FormControl, InputLabel, Select, MenuItem } from '@mui/material';
import { Add, Save } from '@mui/icons-material';

const StudentRegistration = () => {
  const [formData, setFormData] = useState({
    rollNumber: '',
    name: '',
    email: '',
    phone: '',
    department: '',
    semester: '',
    password: ''
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate form data
    if (!formData.rollNumber || !formData.name || !formData.email || !formData.department || !formData.semester || !formData.password) {
      alert('Please fill in all required fields');
      return;
    }

    // Simulate student registration (replace with actual API call)
    console.log('Registering student:', formData);
    alert('Student registered successfully!');

    // Clear form after successful registration
    setFormData({
      rollNumber: '',
      name: '',
      email: '',
      phone: '',
      department: '',
      semester: '',
      password: ''
    });
  };

  return (
    <Box>
      {/* Header */}
      <Box sx={{ bgcolor: '#f5f5f5', p: 3 }}>
        <Container>
          <Typography variant="h4" component="h1" gutterBottom>
            Student Registration
          </Typography>
          <Typography variant="subtitle1" color="text.secondary">
            Register new students
          </Typography>
        </Container>
      </Box>

      {/* Registration Form */}
      <Container sx={{ py: 4 }}>
        <Card>
          <CardContent>
            <Typography variant="h5" gutterBottom>
              Register New Student
            </Typography>
            <form onSubmit={handleSubmit}>
              <Grid container spacing={3}>
                <Grid item xs={12} md={6}>
                  <TextField
                    fullWidth
                    name="rollNumber"
                    label="Roll Number"
                    value={formData.rollNumber}
                    onChange={handleInputChange}
                    required
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <TextField
                    fullWidth
                    name="name"
                    label="Full Name"
                    value={formData.name}
                    onChange={handleInputChange}
                    required
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <TextField
                    fullWidth
                    name="email"
                    label="Email"
                    type="email"
                    value={formData.email}
                    onChange={handleInputChange}
                    required
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <TextField
                    fullWidth
                    name="phone"
                    label="Phone Number"
                    type="tel"
                    value={formData.phone}
                    onChange={handleInputChange}
                  />
                </Grid>
                <Grid item xs={12} md={6}>
                  <FormControl fullWidth>
                    <InputLabel>Department</InputLabel>
                    <Select
                      name="department"
                      value={formData.department}
                      onChange={handleInputChange}
                      label="Department"
                      required
                    >
                      <MenuItem value="IT">Information Technology</MenuItem>
                      <MenuItem value="CSE">Computer Science</MenuItem>
                      <MenuItem value="ECE">Electronics & Communication</MenuItem>
                      <MenuItem value="MECH">Mechanical Engineering</MenuItem>
                      <MenuItem value="CIVIL">Civil Engineering</MenuItem>
                    </Select>
                  </FormControl>
                </Grid>
                <Grid item xs={12} md={6}>
                  <FormControl fullWidth>
                    <InputLabel>Semester</InputLabel>
                    <Select
                      name="semester"
                      value={formData.semester}
                      onChange={handleInputChange}
                      label="Semester"
                      required
                    >
                      {[1, 2, 3, 4, 5, 6, 7, 8].map((semester) => (
                        <MenuItem key={semester} value={semester}>
                          Semester {semester}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                </Grid>
                <Grid item xs={12} md={6}>
                  <TextField
                    fullWidth
                    name="password"
                    label="Password"
                    type="password"
                    value={formData.password}
                    onChange={handleInputChange}
                    required
                  />
                </Grid>
                <Grid item xs={12}>
                  <Button 
                    type="submit" 
                    variant="contained" 
                    color="primary"
                    startIcon={<Save />}
                    fullWidth
                  >
                    Register Student
                  </Button>
                </Grid>
              </Grid>
            </form>
          </CardContent>
        </Card>
      </Container>
    </Box>
  );
};

export default StudentRegistration;
